        this.state({
            width:0,
            height:0
        })

    }


    render(){
        const reel= {
            flex:1,
            flexDirection: "row",
            backgroundColor:"pink"
        }
        return( 
            <div style={reel} width={this.props.width} height={this.props.height}>

